import React from 'react';


import { BrowserRouter, Routes, Route} from 'react-router-dom';
import CrearCompetencia from "./pages/CrearCompetencia";
import CrearEvento from "./pages/CrearEvento";
import CrearTipoEvento from "./pages/CrearTipoEvento";
import Home from "./pages/Home.jsx";

function App(){
  return(
    <BrowserRouter>
    
      <Routes>
        <Route path = "/" element ={<Home />} />
        <Route path = "/Home" element ={<Home />} />
        <Route path ="/CrearEvento" element={<CrearEvento/>}/>
        <Route path ="/CrearTipoEvento" element={<CrearTipoEvento />} />
        <Route path ="/CrearCompetencia" element={<CrearCompetencia />} />
      </Routes>
    
    </BrowserRouter>
      
   
  );
}
export default App;
